INSERT INTO `event` VALUES (6,'5th International Hybrid Conference on Food Science and Nutrition','Current Innovative Research Trends in Diet with Best Nutritional Values\n\nIn recent years, groundbreaking research in diet and nutrition has reshaped our understanding of optimal health and well-being. Scientists are exploring personalized nutrition, leveraging genetic and microbiome data to tailor diets that maximize nutrient absorption and metabolic efficiency. Advances in plant-based proteins, functional foods, and sustainable dietary practices are also gaining momentum, emphasizing not only health benefits but also environmental impact. Emerging trends such as precision nutrition and AI-driven meal planning are revolutionizing how individuals meet their nutritional needs based on unique physiological markers.\n\nMoreover, researchers are investigating bioactive compounds in foods that contribute to disease prevention and overall longevity. Studies on gut microbiota and its influence on mental health, metabolic disorders, and immune function highlight the critical role of diet in holistic wellness. The integration of nutrigenomics, fortification techniques, and innovative food technology ensures that future diets will not only be rich in essential nutrients but also tailored for individual health goals. As scientific advancements continue, the future of nutrition holds immense potential to transform dietary habits, enhance well-being, and combat global health challenges.','2025-03-29 08:00:00','Orlando, Florida, USA','/image/1743150986934-880720233.jpg','https://www.foodscience.averconferences.com','09:09:00','12:00:00','Kindly verify or double check your schedule date. It seems to be already in the past.',0,9,'2025-03-28 16:36:27',9,'2025-03-28 16:37:57'),(9,'5th International','Current Innovative Research Trends in Diet with Best Nutritional Values\n\nIn recent years, nutritional science has undergone a major transformation, focusing on personalized and functional nutrition. Innovative research trends emphasize precision nutrition, where diet plans are tailored based on an individual’s genetics, microbiome, and lifestyle. Plant-based diets, such as flexitarian or Mediterranean-style eating, continue to rise due to their sustainability and proven health benefits. Additionally, functional foods—those with added health benefits like probiotics, omega-3s, and antioxidants—are gaining popularity. Advances in nutrigenomics and AI-driven dietary tracking are also helping researchers understand how specific nutrients affect individuals differently. Overall, the latest trends prioritize a holistic, sustainable, and science-driven approach to achieving optimal health through diet.','2025-04-12 08:00:00','cebu city','/image/1744335134194-780430211.jpg',NULL,'10:30:00','12:30:00',NULL,1,9,'2025-04-11 09:32:14',9,NULL),(11,'This is a lorem ipsum test article','test','2025-04-24 08:00:00','cebu city','/image/1745402446599-86357596.png',NULL,'20:00:00','22:00:00',NULL,1,1,'2025-04-23 18:00:47',1,NULL),(14,'National Wellness Fair 2025','A nationwide health and wellness fair featuring free health screenings, fitness workshops, nutrition seminars, and mental health consultations. Open to all ages and communities to promote a holistic approach to well-being.','2025-12-05 08:00:00','SMX Convention Center, Pasay City, Metro Manila','/image/1745481762636-693489236.jpg','https://wellnessfair2025.ph/register','09:00:00','17:00:00',NULL,1,17,'2025-04-24 16:02:43',17,NULL),(15,'Mental Health Awareness Webinar Breaking the Stigma','An online forum that highlights the importance of mental health, shares coping strategies, and features guest psychologists and advocates discussing how to address stigma in Filipino communities.','2025-10-06 08:00:00','Zoom (Online Event)','/image/1745481818495-431718302.jpg','https://mentalhealthawarenessph.com/signup','14:00:00','16:00:00',NULL,1,17,'2025-04-24 16:03:39',17,NULL),(16,'Free Community Zumba & Nutrition Talk','Kickstart your day with an energizing Zumba session followed by a practical talk from licensed nutritionists on how to prepare healthy meals on a budget. Perfect for families and health-conscious individuals.','2025-05-04 08:00:00','Quezon Memorial Circle, Quezon City','/image/1745481885420-309613891.jpg','https://healthylivingqc.org/register','07:00:00','10:00:00',NULL,1,17,'2025-04-24 16:04:45',17,NULL),(19,'Something Event','Something Event','2025-04-27 08:00:00','cebu city','/image/1745665632663-461500199.jpg','https://www.youtube.com/watch?v=Tsn5EsJNDJQ','13:06:00','16:06:00','test event',1,1,'2025-04-26 19:07:13',1,NULL),(20,'test101','test','2025-04-30 08:00:00','cebu city',NULL,NULL,'18:10:00','22:10:00','test 103',0,1,'2025-04-28 16:11:09',1,NULL);
