INSERT INTO `meal` VALUES (1,'Oatmeal with Banana','Add all of the ingredients to a small pot stovetop and mix well.\nCook over medium-low heat, stirring and mashing the banana with a wooden spoon as it cooks and softens.\nCook for 8-10 minutes until thick and creamy, stirring frequently so it doesn’t burn or stick to the bottom of the pan. I like to remove the pot from the heat after 8-10 minutes and let sit for a few more minutes to thicken a little more. If you want it a little creamier, stir in a little additional almond milk, light coconut milk or other plant milk of choice to reach desired consistency. \nScoop into a bowl and enjoy with your favorite toppings such as chopped walnuts, blueberries or almond butter.','NA','/image/1744554326204-787819509.jpg',9,'2025-04-13 07:32:33',9,'2025-04-13 22:25:26'),(2,'Minute Salmon & Creamy Orzo with Spinach & Mushrooms','Step 1.\nPreheat oven to 450°F.\n\nStep 2.\nStir broth, cream, garlic powder, ¼ teaspoon salt and ⅛ teaspoon pepper together in a large skillet. Add mushrooms and orzo, cover and bring to a boil over high heat. Stir in spinach, reduce heat to maintain a lively simmer, cover and cook until the orzo is tender and the sauce has reduced and thickened, 10 to 12 minutes.\n\nStep 3.\nMeanwhile, brush oil on both sides of salmon pieces. Sprinkle with the remaining ¼ teaspoon each salt and pepper. Place on a baking sheet and roast until just cooked through, 8 to 10 minutes. Serve the salmon with the orzo.',NULL,'/image/1744612574921-634299074.png',9,'2025-04-14 14:36:15',9,'2025-04-14 14:44:20'),(13,'Milk tea','mix all',NULL,NULL,9,'2025-04-26 19:19:24',9,'2025-04-26 19:20:05'),(14,'test1','',NULL,NULL,9,'2025-04-29 01:47:16',9,NULL),(15,'test2','',NULL,NULL,9,'2025-04-29 01:47:22',9,NULL),(16,'test3','',NULL,NULL,9,'2025-04-29 01:47:28',9,NULL),(17,'test4','',NULL,NULL,9,'2025-04-29 01:47:33',9,NULL),(18,'test5','',NULL,NULL,9,'2025-04-29 01:47:41',9,NULL),(19,'test6','',NULL,NULL,9,'2025-04-29 01:47:53',9,'2025-04-29 01:48:03'),(20,'test10','',NULL,NULL,9,'2025-04-29 02:10:42',9,NULL),(21,'test11','',NULL,NULL,9,'2025-04-29 02:15:48',9,NULL),(24,'test12','',NULL,NULL,9,'2025-04-29 02:23:15',9,NULL),(25,'test13','',NULL,NULL,9,'2025-04-29 02:23:49',9,NULL),(26,'test112','',NULL,NULL,9,'2025-04-29 02:25:32',9,NULL),(27,'test14','',NULL,NULL,9,'2025-04-29 02:27:06',9,NULL),(28,'test16','',NULL,NULL,9,'2025-04-29 02:27:46',9,NULL),(29,'test17','',NULL,NULL,9,'2025-04-29 02:28:10',9,NULL);
